INSERT INTO `dashb_panel_html_i18n` VALUES (72,'de','<h1>Externe Verbindungen</h1>'),(72,'en','<h1>External Connections</h1>'),(72,'es','<h1>Conexiones externas</h1>'),(72,'fr','<h1>Connections externes</h1>'),(72,'ja','<h1>外部接続</h1>'),(72,'pt','<h1>Conexões Externas</h1>'),(72,'ru','<h1>Внешние соединения</h1>'),(72,'zh','<h1>外部连接</h1>'),(82,'de','<h1>Willkommen beim JBoss-Dashboard Generator</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />Der JBoss Dashboard Generator ist ein Open Source Dashboard- und Berichts-Tool, das Folgendes ermöglicht:</p>\n<p>&nbsp;</p>\n<ul>\n    <li>Visuelle Konfiguration und Anpassung von Dashboards.</li>\n    <li>Grafische Darstellung von KPIs (Key Performance Indicators).</li>\n    <li>Definition vom interaktiven Bericht-Tabellen.</li>\n    <li>Filter und Suche im Speicher oder auf Datenbank-Basis.</li>\n</ul>\n<ul>\n    <li>Verarbeitung von Ausführungs-Metrik Dashboards.</li>\n    <li>Datensammlung aus externen Systemen über unterschiedliche Protokolle.</li>\n    <li>Zugriffskontrolle für verschiedene Benutzerprofile auf verschiedenen Informationsebenen.</li>\n</ul>\n<br />\n<br />\n<h2>Bevorstehende Funktionen</h2>\n&nbsp;\n<ul>\n    <li>Weitere Diagrammtypen</li>\n    <li>Unterstützung für mehrere Datenreihen.</li>\n    <li><span style=\"font-size: 9pt;\">Kompletter Import und Export von Dashboards.</span></li>\n    <li>Neue Verbindungen zu NoSQL Datenbanken.</li>\n    <li>Support für Echtzeit Datenströme.</li>\n    <li>Prognosemodelle.</li>\n</ul>'),(82,'en','<h1>Welcome to JBoss Dashboard Builder</h1>\r\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss Dashboard Builder is an open source dashboard and reporting tool that allows:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n    <li>Visual configuration and personalization of dashboards.</li>\r\n    <li>Graphical representation of KPIs (Key Performance Indicators).</li>\r\n    <li>Definition of interactive report tables.</li>\r\n    <li>Filtering and search, both in-memory or database based.</li>\r\n</ul>\r\n<ul>\r\n    <li>Process execution metrics dashboards.</li>\r\n    <li>Data extraction from external systems, through different protocols.</li>\r\n    <li>Access control for different user profiles to different levels of information.</li>\r\n</ul>\r\n<br />\r\n<br />\r\n<h2>Upcoming features</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Additional chart types.</li>\r\n    <li>Support for multiple data series.</li>\r\n    <li><span style=\"font-size: 9pt;\">Complete import and export of dashboards.</span></li>\r\n    <li>New connectors to NoSQL databases.</li>\r\n    <li>Real-time data feeds support.</li>\r\n    <li>Predictive models.</li>\r\n</ul>'),(82,'es','<h1>Bienvenido a JBoss Dashboard Builder</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" /></p>\n<p>JBoss Dashboard Builder&nbsp;es una herramienta de código abierto para realizar paneles e informes que permite:<br />\n&nbsp;</p>\n<ul>\n    <li>Configuración visual y personalización de paneles.</li>\n    <li>Representación gráfica de KPI (indicadores clave de rendimiento).</li>\n    <li>Definición de tablas de informe interactivas.</li>\n    <li>Filtrado y búsqueda, tanto en memoria como en base de datos.</li>\n</ul>\n<ul>\n    <li>Panel de métrica de ejecución de procesos.</li>\n    <li>Extracción de datos de sistemas externos, a través de distintos protocolos.</li>\n    <li>Control de acceso a los diferentes niveles de información para diferentes perfiles de usuario.</li>\n</ul>\n<br />\n<br />\n<h2><br />\nPróximas funcionalidades:</h2>\n&nbsp;\n<ul>\n    <li>Soporte para múltiples series de datos.</li>\n    <li>Nuevos tipos de gráficas.</li>\n    <li><span style=\"font-size: 9pt;\">Completa exportación e importación de paneles.</span></li>\n    <li>Nuevos conectores a bases de datos NoSQL.</li>\n    <li>Datos en tiempo real.</li>\n    <li>Modelos predictivos.</li>\n</ul>'),(82,'fr','<h1>Bienvenue dans JBoss Dashboard Builder</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss Dashboard Builder est un tableau de bord et un outil de génération de rapports qui vous permet :</p>\n<p>&nbsp;</p>\n<ul>\n    <li>La visualisation et la personnalisation des tableaux de bord.</li>\n    <li>La représentation graphique des KPI (Indicateurs clés de performance).</li>\n    <li>Définition de tableaux de rapports interactifs.</li>\n    <li>Filtrage et recherche, tous deux basés mémoire ou base de données.</li>\n</ul>\n<ul>\n    <li>Tableaux de bord de métriques d\'exécution de processus.</li>\n    <li>Extraction des données de systèmes externes, par des protocoles divers.</li>\n    <li>Contrôle de l\'accès par différents profils d\'utilisateurs vers différents niveaux d\'information.</li>\n</ul>\n<br />\n<br />\n<h2>Caractéristiques de produits à venir</h2>\n&nbsp;\n<ul>\n    <li>Types de diagrammes supplémentaires.</li>\n    <li>Support des séries de données multiples.</li>\n<li><span style=\"font-size: 9pt;\">Import et export complet de tableaux de bord.</span></li>\n    <li>Nouveaux connecteurs vers bases de données NoSQL.</li>\n     <li>Support des flux de données en temps réel.</li>\n    <li>Modèles de prédiction.</li>\n</ul>'),(82,'ja','<h1>JBoss ダッシュボードビルダー</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss ダッシュボードビルダーはオープンソースのダッシュボードおよびレポーティングツールで、以下の機能を提供します。:</p>\n<p>&nbsp;</p>\n<ul>\n    <li>ダッシュボードの構成とパーソナライゼーション</li>\n    <li>KPI(重要業績評価指標)のグラフィカルな表現</li>\n    <li>対話型レポートテーブルの定義</li>\n    <li>フィルターと検索 (インメモリまたはデータベース)</li>\n</ul>\n<ul>\n    <li>プロセス実行メトリクスダッシュボード</li>\n    <li>異なるプロトコルの外部システムからのデータ抽出</li>\n    <li>ユーザープロファイルに対するアクセス制御</li>\n</ul>\n<br />\n<br />\n<h2>次期バージョンで実装予定の機能</h2>\n&nbsp;\n<ul>\n    <li>追加のチャートタイプ</li>\n    <li>複数のデータ集合サポート</li>\n    <li><span style=\"font-size: 9pt;\">ダッシュボードの完全なインポート・エクスポート</span></li>\n    <li>NoSQLデータベースのコネクタ</li>\n    <li>リアルタイムのデータフィードサポート</li>\n    <li>予測モデル</li>\n</ul>'),(82,'pt','<h1>Bem-Vindo ao JBoss Dashboard Builder</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />O JBoss Dashboard Builder é um painel de código aberto e a ferramenta de relatório que permite:</p>\n<p>&nbsp;</p>\n<ul>\n    <li>A configuração visual e personalização dos painéis.</li>\n    <li>A representação gráfica dos KPIs (Indicadores de Desempenho Chave).</li>\n    <li>Definição das tabelas de relatório interativo.</li>\n    <li>Filtro e busca, ambos em memória ou baseado no banco de dados.</li>\n</ul>\n<ul>\n    <li>Painéis das métricas de execução do processo.</li>\n    <li>Extração de dados a partir dos sistemas externos, através de protocolos.</li>\n    <li>Controle de acesso para perfis de usuário diferente para diferente níveis de informação.</li>\n</ul>\n<br />\n<br />\n<h2>Recursos novos</h2>\n&nbsp;\n<ul>\n    <li>Tipos de gráfico adicional</li>\n    <li>Suporte para séries de dados múltiplos.</li>\n    <li><span style=\"font-size: 9pt;\">Importação e exportação dos painéis completa.</span></li>\n    <li>Novos conectores aos bancos de dados NoSQL.</li>\n    <li>Dados em tempor real alimentam suporte.</li>\n    <li>Modelos de predicção.</li>\n</ul>'),(82,'ru','<h1>Вас приветствует JBoss Dashboard Builder</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss Dashboard Builder — открытое решение для формирования отчетности и визуальной аналитики. Его основные возможности:</p>\n<p>&nbsp;</p>\n<ul>\n    <li>Визуальная настройка и персонализация информационных панелей.</li>\n    <li>Графическое представление ключевых показателей эффективности.</li>\n    <li>Создание интерактивных табличных отчетов.</li>\n    <li>Фильтрация и поиск в памяти и в базах данных.</li>\n</ul>\n<ul>\n    <li>Построение метрики выполнения процессов.</li>\n    <li>Извлечение данных из разнородных внешних систем с использованием подходящих протоколов.</li>\n    <li>Управление уровнем доступа пользователей к информации.</li>\n</ul>\n<br />\n<br />\n<h2>Проектируемые функции</h2>\n&nbsp;\n<ul>\n    <li>Добавление новых видов диаграмм.</li>\n    <li>Поддержка многочисленных рядов данных.</li>\n    <li><span style=\"font-size: 9pt;\">Полнофункциональный импорт и экспорт информационных панелей.</span></li>\n    <li>Поддержка коннекторов баз данных NoSQL.</li>\n    <li>Сбор данных в режиме реального времени.</li>\n    <li>Предикативные модели.</li>\n</ul>'),(82,'zh','<h1>欢迎使用 JBoss 仪表板构建器</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss 仪表板构建器是一个开源的仪表板和报表工具，它允许：</p>\n<p>&nbsp;</p>\n<ul>\n    <li>仪表板的可视化配置和个性化设置。</li>\n    <li>关键性能指标的图形化表示。</li>\n    <li>交互式报表的定义。</li>\n    <li>基于内存或数据库的过滤和搜索。</li>\n</ul>\n<ul>\n    <li>流程执行度量的仪表板。</li>\n    <li>通过不同的协议从外部系统抽取数据。</li>\n    <li>不同用户配置对不同级别信息的访问的控制。</li>\n</ul>\n<br />\n<br />\n<h2>即将引入的产品功能</h2>\n&nbsp;\n<ul>\n    <li>额外的图表类型。</li>\n    <li>对多重数据序列的支持。</li>\n    <li>可插拔的图表库，用于对 SVG/HTML5 的支持。</li>\n    <li>将数据导出为多种格式，如 CSV、native Excel、XML 或其他。</li>\n    <li>仪表板的完整导入和导出。</li>\n    <li>到 NoSQL 数据库的新连接器。</li>\n</ul>'),(339,'de','<h1>Import und Export</h1>'),(339,'en','<h1>Import and Export</h1>'),(339,'es','<h1>Importar y exportar</h1>'),(339,'fr','<h1>Import et Export</h1>'),(339,'ja','<h1>インポートとエクスポート</h1>'),(339,'pt','<h1>Importar e Exportar</h1>'),(339,'ru','<h1>Импорт и экспорт</h1>'),(339,'zh','<h1>导入和导出</h1>'),(349,'de','<h1>Daten-Anbieter</h1>'),(349,'en','<h1>Data Providers</h1>'),(349,'es','<h1>Proveedores de datos</h1>'),(349,'fr','<h1>Fournisseurs de données</h1>'),(349,'ja','<h1>データプロバイダー</h1>'),(349,'pt','<h1>Provedores de Dados</h1>'),(349,'ru','<h1>Провайдеры данных</h1>'),(349,'zh','<h1>数据供应商</h1>'),(510,'de','<h1>Vertriebsmöglichkeiten</h1>'),(510,'en','<h1>Sales Opportunities</h1>'),(510,'es','<h1>Oportunidades de ventas</h1>'),(510,'fr','<h1>Opportunités de ventes</h1>'),(510,'ja','<h1>セールスオポチュニティー</h1>'),(510,'pt','<h1>Oportunidades de Venda</h1>'),(510,'ru','<h1>Прогнозирование продаж</h1>'),(510,'zh','<h1>销售机会</h1>'),(520,'de','<h1>In Vorbereitung-Analyse</h1>'),(520,'en','<h1>Pipeline Analysis</h1>'),(520,'es','<h1>Análisis de Pipeline</h1>'),(520,'fr','<h1>Analyse Pipeline</h1>'),(520,'ja','<h1>パイプライン分析</h1>'),(520,'pt','<h1>Análise Pipeline</h1>'),(520,'ru','<h1>Анализ объема продаж</h1>'),(520,'zh','<h1>管道分析</h1>'),(530,'de','<h1>Vertriebsbericht</H1>'),(530,'en','<h1>Sales Report</H1>'),(530,'es','<h1>Informe de ventas</H1>'),(530,'fr','<h1>Rapport des ventes</H1>'),(530,'ja','<h1>セールスレポート</h1>'),(530,'pt','<h1>Relatório de Vendas</H1>'),(530,'ru','<h1>Отчет о продажах</H1>'),(530,'zh','<h1>销售报表</H1>'),(550,'de','<h1>Beispiel-Dashboards</h1>'),(550,'en','<h1>Sample Dashboards</h1>'),(550,'es','<h1>Ejemplos</h1>'),(550,'fr','<h1>Exemples de tableaux de bord</h1>'),(550,'ja','<h1>サンプルダッシュボード</h1>'),(550,'pt','<h1>Painéis de amostra</h1>'),(550,'ru','<h1>Примеры панелей анализа</h1>'),(550,'zh','<h1>仪表板示例</h1>'),(560,'de','<h1>Verwaltung</h1>'),(560,'en','<h1>Administration</h1>'),(560,'es','<h1>Administración</h1>'),(560,'fr','<h1>Administration</h1>'),(560,'ja','<h1>管理</h1>'),(560,'pt','<h1>Administração</h1>'),(560,'ru','<h1>Администрирование</h1>'),(560,'zh','<h1>管理</h1>'),(570,'de','<h1>Nach Land:\n{dashboard_selectedvalues, Country}</h1>'),(570,'en','<h1>By Country:\r\n{dashboard_selectedvalues, Country}</h1>'),(570,'es','<h1>Por país:\n{dashboard_selectedvalues, Country}</h1>'),(570,'fr','<h1>Par pays:\n{dashboard_selectedvalues, Country}</h1>'),(570,'ja','<h1>国別:\n{dashboard_selectedvalues, Country}</h1>'),(570,'pt','<h1>Por país:\n{dashboard_selectedvalues, Country}</h1>'),(570,'ru','<h1>Страна:\n{dashboard_selectedvalues, Country}</h1>'),(570,'zh','<h1>按国家:\n{dashboard_selectedvalues, Country}</h1>'),(602,'de','<h3><br />\n{dashboard_count, id} Ausgabenberichte<br />\nGesamtmenge&nbsp;<b>$ {dashboard_sum, amount}</b></h3>'),(602,'en','<h3><br />\r\n{dashboard_count, id} Expense reports<br />\r\nTotal amount&nbsp;<b>$ {dashboard_sum, amount}</b></h3>'),(602,'es','<br><h3>N&ordm; Notas de gastos: {dashboard_count, id}<br />\nTotal gastos: {dashboard_sum, amount} &euro;</h3>'),(602,'fr','<h3><br />\n  {dashboard_count, id} Rapports de dépenses<br />\nMontant total&nbsp;<b>$ {dashboard_sum, amount}</b></h3>'),(602,'ja','<h3><br />\n{dashboard_count, id} 経費レポート<br />\n合計金額&nbsp;<b>$ {dashboard_sum, amount}</b></h3>'),(602,'pt','<h3><br />\n{dashboard_count, id} Relatório de despesas<br />\nQuantia total&nbsp;<b>$ {dashboard_sum, amount}</b></h3>'),(602,'ru','<h3><br />\nОтчеты о продажах: {dashboard_count, id}<br />\nНа общую сумму: &nbsp;<b>$ {dashboard_sum, amount}</b></h3>'),(602,'zh','<h3><br />\n{dashboard_count, id} 费用报告<br />\n总金额&nbsp;<b>$ {dashboard_sum, amount}</b></h3>'),(669,'de','<h1>Ausgabenberichte</h1>'),(669,'en','<h1>Expense Reports</h1>'),(669,'es','<h1>Nota de gastos</h1>'),(669,'fr','<h1>Rapports des dépenses</h1>'),(669,'ja','<h1>経費レポート</h1>'),(669,'pt','<h1>Relatórios de Despesas</h1>'),(669,'ru','<h1>Отчеты о расходах</h1>'),(669,'zh','<h1>费用报告</h1>'),(690,'de','<p><img width=\"570\" height=\"425\" title=\"JBoss Business Activity Monitoring and Reporting\" alt=\"JBoss Business Activity Monitoring and Reporting\" src=\"images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\n<p><br />\nDieser Abschnitt bietet Zugriff auf die Tools zur Verwaltung dieser Installation:<br />\n&nbsp;&nbsp;</p>\n<h2>&nbsp;</h2>\n<h2>Daten Anbieter:</h2>\n&nbsp;\n<ul>\n    <li>Erstellung und Konfiguration von BAM Daten Anbietern zum Abruf von Informationen.&nbsp;</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Externe Verbindungen:</h2>\n&nbsp;\n<ul>\n    <li>Definition von Verbindungs-Parametern zu Datenbanken oder anderen Systemen.</li>\n</ul>\n<br type=\"_moz\" />\n<h2>Import und Export:</h2>\n&nbsp;\n<ul>\n    <li>Import und Export der verschiedenen Assets, um Dashboards über Systeme hinweg zu verschieben.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(690,'en','<p><img width=\"570\" height=\"425\" title=\"JBoss Business Activity Monitoring and Reporting\" alt=\"JBoss Business Activity Monitoring and Reporting\" src=\"images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\r\n<p><br />\r\nThis section provides access to the tools for managing this installation:<br />\r\n&nbsp;&nbsp;</p>\r\n<h2>&nbsp;</h2>\r\n<h2>Data providers:</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Create and configure BAM data providers to retrieve information.&nbsp;</li>\r\n</ul>\r\n<br type=\"_moz\" />\r\n<br type=\"_moz\" />\r\n<h2>External connections:</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Define connection parameters to databases or other systems.</li>\r\n</ul>\r\n<br type=\"_moz\" />\r\n<h2>Import and export:</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Import and export the different assets to move dashboards accross systems.</li>\r\n</ul>\r\n<br type=\"_moz\" />\r\n<br type=\"_moz\" />'),(690,'es','<p><img width=\"570\" height=\"425\" title=\"JBoss Business Activity Monitoring and Reporting\" alt=\"JBoss Business Activity Monitoring and Reporting\" src=\"images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\n<p><br />\nEsta sección proporciona acceso a las diferentes herramientas para administrar el sistema:<br />\n&nbsp;&nbsp;</p>\n<h2>&nbsp;</h2>\n<h2>Proveedores de datos:</h2>\n&nbsp;&nbsp;<br />\n<ul>\n    <li>Crear y configurar proveedores de datos de BAM para recuperar información.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Conexiones externas:</h2>\n&nbsp;\n<ul>\n    <li>Definir los parámetros de conexión a bases de datos u otros sistemas.</li>\n</ul>\n<br type=\"_moz\" />\n<h2>Importar y exportar:</h2>\n&nbsp;\n<ul>\n    <li>Importar y exportar la estructura de los paneles e indicadores para poder traspasar diferentes entornos.</li>\n</ul>\n<br type=\"_moz\" />'),(690,'fr','<p><img width=\"570\" height=\"425\" title=\"JBoss Business Activity Monitoring and Reporting\" alt=\"JBoss Business Activity Monitoring and Reporting\" src=\"images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\n<p><br />\nCette section procure aux outils un accès pour gérer cette installation:<br />\n&nbsp;&nbsp;</p>\n<h2>&nbsp;</h2>\n<h2>Fournisseurs de données:</h2>\n&nbsp;\n<ul>\n    <li>Créer et configurer les fournisseurs de données BAM pour extraire des informations.&nbsp;</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Connections externes:</h2>\n&nbsp;\n<ul>\n    <li>Définissent les paramètres de connexion pour les bases de données ou autres systèmes.</li>\n</ul>\n<br type=\"_moz\" />\n<h2>Import et export:</h2>\n&nbsp;\n<ul>\n    <li>Importent et exportent les diverses ressources pour déplacer les tableaux de bords à travers les systèmes.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(690,'ja','<p><img width=\"570\" height=\"425\" title=\"JBoss Business Activity Monitoring and Reporting\" alt=\"JBoss Business Activity Monitoring and Reporting\" src=\"images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\n<p><br />\nこの環境を管理するツールのリスト:<br />\n&nbsp;&nbsp;</p>\n<h2>&nbsp;</h2>\n<h2>データプロバイダ:</h2>\n&nbsp;\n<ul>\n    <li>情報を抽出するBAMデータプロバイダの作成と設定&nbsp;</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>外部接続:</h2>\n&nbsp;\n<ul>\n    <li>データベースやその他システムへの接続パラメータの定義</li>\n</ul>\n<br type=\"_moz\" />\n<h2>インポートとエクスポート:</h2>\n&nbsp;\n<ul>\n    <li>システム間でダッシュボードをインポートまたはエクスポート</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(690,'pt','<p><img width=\"570\" height=\"425\" title=\"JBoss Business Activity Monitoring and Reporting\" alt=\"JBoss Business Activity Monitoring and Reporting\" src=\"images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\n<p><br />\nEsta seção fornece acesso às ferramentas para gerenciamento desta instalação:<br />\n&nbsp;&nbsp;</p>\n<h2>&nbsp;</h2>\n<h2>Provedores de Dados:</h2>\n&nbsp;\n<ul>\n    <li>Criar e configurar os provedores de dados BAM para restaurar informação.&nbsp;</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Conexões externas:</h2>\n&nbsp;\n<ul>\n    <li>Define connection parameters to databases or other systems.</li>\n</ul>\n<br type=\"_moz\" />\n<h2>Importar e exportar:</h2>\n&nbsp;\n<ul>\n    <li>Importar e exportar os ativos diferentes para mover os painéis através dos sistemas.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(690,'ru','<p><img width=\"570\" height=\"425\" title=\"Подготовка отчетности и мониторинг бизнес-деятельности JBoss\" alt=\"Подготовка отчетности и мониторинг бизнес-деятельности JBoss\" src=\"images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\n<p><br />\nВ этой секции можно найти все необходимые инструменты администрирования.<br />\n&nbsp;&nbsp;</p>\n<h2>&nbsp;</h2>\n<h2>Провайдеры данных:</h2>\n&nbsp;\n<ul>\n    <li>Создание и конфигурация провайдеров данных для подключения к внешним источникам данных.&nbsp;</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Внешние соединения:</h2>\n&nbsp;\n<ul>\n    <li>Настройка соединения с базой данных или другой системой.</li>\n</ul>\n<br type=\"_moz\" />\n<h2>Импорт и экспорт:</h2>\n&nbsp;\n<ul>\n    <li>Импорт и экспорт ресурсов с целью переноса информационных панелей между системами.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(690,'zh','<p><img width=\"570\" height=\"425\" title=\"JBoss Business Activity Monitoring and Reporting\" alt=\"JBoss Business Activity Monitoring and Reporting\" src=\"collage/images/AdministrationImage.jpg\" style=\"float: right;\" /></p>\n<p><br />\n这部分提供对管理这个安装的工具的访问：<br />\n&nbsp;&nbsp;</p>\n<h2>&nbsp;</h2>\n<h2>数据供应商：</h2>\n&nbsp;\n<ul>\n    <li>创建和配置 BAM 数据供应商来获取信息。&nbsp;</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>外部连接:</h2>\n&nbsp;\n<ul>\n    <li>定义数据库和其他系统的连接参数。</li>\n</ul>\n<br type=\"_moz\" />\n<h2>导入和导出:</h2>\n&nbsp;\n<ul>\n    <li>导入和导出不同的资产来在系统间移动仪表板。</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(700,'de','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"JBoss Business Activity Monitoring and Reporting\" title=\"JBoss Business Activity Monitoring and Reporting\" /></p>\n<p><br />\nIn diesem Abschnitt finden Sie Beispiel-Dashboards, die einige Funktionen des Produkts veranschaulichen sollen.<br />\n&nbsp;</p>\n<br />\n<h2>Dashboard für Vertriebsmöglichkeiten:</h2>\n&nbsp;\n<ul>\n    <li>Beispiel für Dashboard im CRM-Stil.</li>\n    <li>Basiert auf CSV-Daten.</li>\n    <li>Detaillierte Ansicht anderer Abschnitte.</li>\n    <li>Bericht-Tabellen.</li>\n    <li>Filtern und Suchen.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Dashboard Ausgabenberichte:</h2>\n&nbsp;\n<ul>\n    <li>Beispiel für Minimal-Dashboard.</li>\n    <li>Mehr Details ohne Änderung des Kontextes.</li>\n    <li>Dynamische Titel für Dashboard-Abschnitte.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(700,'en','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"JBoss Business Activity Monitoring and Reporting\" title=\"JBoss Business Activity Monitoring and Reporting\" /></p>\r\n<p><br />\r\nIn this section you will find some sample dashboards that demonstrate some of the product\'s functionality.<br />\r\n&nbsp;</p>\r\n<br />\r\n<h2>Sales opportunities dashboard:</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Example of CRM style dashboard.</li>\r\n    <li>Based on CSV data.</li>\r\n    <li>Drill down to other sections.</li>\r\n    <li>Reporting tables.</li>\r\n    <li>Filter and search.</li>\r\n</ul>\r\n<br type=\"_moz\" />\r\n<br type=\"_moz\" />\r\n<h2>Expense reports dashboard:</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Example of a minimal dashboard.</li>\r\n    <li>Drill down without changing context.</li>\r\n    <li>Dynamic titles for dashboard sections.</li>\r\n</ul>\r\n<br type=\"_moz\" />\r\n<br type=\"_moz\" />'),(700,'es','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"JBoss Business Activity Monitoring and Reporting\" title=\"JBoss Business Activity Monitoring and Reporting\" /></p>\n<p><br />\nEn esta sección encontrará algunos ejemplos de paneles, que demuestran el uso de algunas de las principales funcionalidades del producto.<br />\n&nbsp;</p>\n<br />\n<h2>Panel de oportunidades de ventas:</h2>\n&nbsp;\n<ul>\n    <li>Ejemplo de un panel similar a un CRM.</li>\n    <li>Basado en datos CSV.</li>\n    <li><em>Drill down </em>a otra secciones.</li>\n    <li>Informes de tabla.</li>\n    <li>Filtro y búsqueda.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Panel de gastos:</h2>\n&nbsp;\n<ul>\n    <li>Ejemplo de un panel sencillo.</li>\n    <li><em>Drill down</em> dentro de la misma p&aacute;gina.</li>\n    <li>T&iacute;tulos dinámicos basados en el filtro actual..</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(700,'fr','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"JBoss Business Activity Monitoring and Reporting\" title=\"JBoss Business Activity Monitoring and Reporting\" /></p>\n<p><br />\nDans cette section, vous trouverez des exemples de tableaux de bord qui démontrent une partie des fonctionnalités du produit.<br />\n&nbsp;</p>\n<br />\n<h2>Tableau de bord des opportunités de vente:</h2>\n&nbsp;\n<ul>\n    <li>Exemple de tableau de bord style CRM.</li>\n    <li>Basé sur les données CSV.</li>\n    <li>Recherche vers le bas de la hiérarchie d\'autres sections.</li>\n    <li>Tableaux de rapports.</li>\n    <li>Filtrage et recherches.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Tableau de bord de rapports de dépenses:</h2>\n&nbsp;\n<ul>\n    <li>Exemple de tableau de bord minimal.</li>\n    <li>Recherche vers le bas sans changer de contexte.</li>\n    <li>Titres dynamiques des sections de tableau de bord.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(700,'ja','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"JBoss Business Activity Monitoring and Reporting\" title=\"JBoss Business Activity Monitoring and Reporting\" /></p>\n<p><br />このセクションでは製品機能を理解するためのサンプルダッシュボードを探すことができます。<br />\n&nbsp;</p>\n<br />\n<h2>セールスオポチュニティーダッシュボード:</h2>\n&nbsp;\n<ul>\n    <li>CRMスタイルダッシュボード</li>\n    <li>CSVデータ</li>\n    <li>別のセクションへのドリルダウン</li>\n    <li>テーブルのレポート</li>\n    <li>フィルターと検索</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>経費レポートダッシュボード:</h2>\n&nbsp;\n<ul>\n    <li>シンプルなダッシュボード</li>\n    <li>コンテキストを変えずにドリルダウン</li>\n    <li>動的なタイトルを持つダッシュボード</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(700,'pt','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"JBoss Business Activity Monitoring and Reporting\" title=\"JBoss Business Activity Monitoring and Reporting\" /></p>\n<p><br />\nNesta seção você irá encontrar algumas amostras de painel que demonstram algumas funcionalidades do produto.<br />\n&nbsp;</p>\n<br />\n<h2>Painel de oportunidades de vendas:</h2>\n&nbsp;\n<ul>\n    <li>Amostra da tela do estilo CRM.</li>>\n    <li>Baseado nos dados do CSV.</li>\n    <li>Busca detalhada nas outras seções.</li>\n    <li>Relatório de tabelas.</li>\n    <li>Filtro e busca.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Painel de relatórios de despesas:</h2>\n&nbsp;\n<ul>\n    <li>Amostra de um painel mínimo.</li>\n    <li>Busca detalhada sem a alteração do contexto.</li>\n    <li>Títulos dinâmicos para as seções do painel.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(700,'ru','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"Подготовка отчетности и мониторинг бизнес-деятельности JBoss\" title=\"Подготовка отчетности и мониторинг бизнес-деятельности JBoss\" /></p>\n<p><br />\nВ этой секции вы найдете готовые примеры информационных панелей, которые продемонстрируют некоторые возможности этого программного продукта.<br />\n&nbsp;</p>\n<br />\n<h2>Прогнозирование продаж:</h2>\n&nbsp;\n<ul>\n    <li>Пример панели, в основу которой положена модель CRM.</li>\n    <li>Исходные данные получены из CSV.</li>\n    <li>Доступ к вложенным компонентам.</li>\n    <li>Таблицы отчетности.</li>\n    <li>Фильтрация и поиск.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>Отчеты о расходах:</h2>\n&nbsp;\n<ul>\n    <li>Компактная информационная панель.</li>\n    <li>Доступ к вложенным данным без изменения контекста.</li>\n    <li>Динамические заголовки секций.</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(700,'zh','<p><img width=\"570\" height=\"425\" style=\"float: right;\" src=\"images/SampleDashboardsImage.jpg\" alt=\"JBoss Business Activity Monitoring and Reporting\" title=\"JBoss Business Activity Monitoring and Reporting\" /></p>\n<p><br />\n在这个部分可找到一些演示产品功能的仪表板示例。<br />\n&nbsp;</p>\n<br />\n<h2>销售机会仪表板:</h2>\n&nbsp;\n<ul>\n    <li>CRM 风格的仪表板的示例。</li>\n    <li>基于 CSV 数据。</li>\n    <li>查看其他部分的明细。</li>\n    <li>报告表。</li>\n    <li>过滤器和搜索。</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />\n<h2>费用报告仪表板：</h2>\n&nbsp;\n<ul>\n    <li>最小仪表板的示例。</li>\n    <li>无需修改内容来查看明细。</li>\n    <li>仪表板部分的动态标题。</li>\n</ul>\n<br type=\"_moz\" />\n<br type=\"_moz\" />'),(727,'de'