flow: hidden; width: auto; font-family: &quot; gotham=&quot;&quot; 4r&quot;,=&quot;&quot; &quot;gotham=&quot;&quot; a&quot;,=&quot;&quot; b&quot;,=&quot;&quot; &quot;open=&quot;&quot; sans&quot;,=&quot;&quot; arial,=&quot;&quot; helvetica,=&quot;&quot; sans-serif;=&quot;&quot; font-style:=&quot;&quot; normal;=&quot;&quot; font-variant-ligatures:=&quot;&quot; font-variant-caps:=&quot;&quot; letter-spacing:=&quot;&quot; orphans:=&quot;&quot; 2;=&quot;&quot; text-align:=&quot;&quot; start;=&quot;&quot; text-indent:=&quot;&quot; 0px;=&quot;&quot; text-transform:=&quot;&quot; none;=&quot;&quot; white-space:=&quot;&quot; widows:=&quot;&quot; word-spacing:=&quot;&quot; -webkit-text-stroke-width:=&quot;&quot; background-color:=&quot;&quot; rgb(255,=&quot;&quot; 255,=&quot;&quot; 255);&quot;=&quot;&quot;&gt;</p>\r\n'),(1395,'es','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este panel y cambie su contenido HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1395,'fr','<p>&nbsp;</p><p><span class=\"skn-error\">Veuillez modifier ce panneau et changer son contenu HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1395,'ja','<p>&nbsp;</p><p><span class=\"skn-error\">このパネルを編集し、HTML コンテンツを変更してください。</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1395,'pt','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este painel e altere seu conteúdo HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1404,'de','<p>&nbsp;</p><p><span class=\"skn-error\">Bitte bearbeiten Sie dieses Panel und ändern Sie dessen HTML-Inhalt.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1404,'en','<p>This section provides access to the tools for managing this installation:<img alt=\"\" src=\"images/AdministrationImage.jpg\" style=\"width: 500px; height: 373px; float: right;\" /><br />\r\n&nbsp;&nbsp;</p>\r\n\r\n<h2>Data Sources:</h2>\r\n\r\n<ul>\r\n	<li>Define connection parameters to databases or other systems.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Data Providers:</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Create and configure BAM data providers to retrieve information.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(1404,'es','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este panel y cambie su contenido HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1404,'fr','<p>&nbsp;</p><p><span class=\"skn-error\">Veuillez modifier ce panneau et changer son contenu HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1404,'ja','<p>&nbsp;</p><p><span class=\"skn-error\">このパネルを編集し、HTML コンテンツを変更してください。</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1404,'pt','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este painel e altere seu conteúdo HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1413,'de','<p>&nbsp;</p><p><span class=\"skn-error\">Bitte bearbeiten Sie dieses Panel und ändern Sie dessen HTML-Inhalt.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1413,'en','<p>In this section you can find 2 sets of dashboards:<img alt=\"\" src=\"images/home-image.jpg\" style=\"width: 500px; height: 373px; float: right;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px;\"><strong>Incidents Dashboard</strong></span>: Shows charts related to the data collection based in car accidents. It drills down to the accident causes so changes in the quote process can be done from an statistical source.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px;\"><strong>Quotes Dashboard</strong></span>: This dashboard shows charts related to the data collection based in the policy quotes and the ending result of a policy quote being sold. All no-sale policy quotes are known as &quot;bounced&quot; and we keep track of the &quot;bounce reasons&quot;. The data shown here might be used to gauge the sales department performance and tune up the offers, campaigns and quote processes from an informed perspective.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n'),(1413,'es','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este panel y cambie su contenido HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1413,'fr','<p>&nbsp;</p><p><span class=\"skn-error\">Veuillez modifier ce panneau et changer son contenu HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1413,'ja','<p>&nbsp;</p><p><span class=\"skn-error\">このパネルを編集し、HTML コンテンツを変更してください。</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1413,'pt','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este painel e altere seu conteúdo HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1449,'de','<p>&nbsp;</p><p><span class=\"skn-error\">Bitte bearbeiten Sie dieses Panel und ändern Sie dessen HTML-Inhalt.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1449,'en','<h1>Do I need dashboards?</h1>\r\n\r\n<p><img alt=\"dashboard\" src=\"images/SampleDashboardsImage.jpg\" style=\"width: 500px; height: 373px; float: right;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Much in the same way a car dashboard provides the driver with key data about their vehicle, a business dashboard offers its user a wealth of data about various aspects of business performance. Different vehicles might need different detail about the travel and mechanical conditions, in the same way different business need different detail about their operation and performance based on their DNA deffinition.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dashbuilder component is a data visualization tool that consolidates and displays the current status of metrics and key performance indicators (KPIs) for an organization, department or specific process. With one glance, a dashboard offers the user an array of important business insights. A dashboard can also be used to define metrics, set performance goals and proactively identify problems.</p>\r\n'),(1449,'es','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este panel y cambie su contenido HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1449,'fr','<p>&nbsp;</p><p><span class=\"skn-error\">Veuillez modifier ce panneau et changer son contenu HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1449,'ja','<p>&nbsp;</p><p><span class=\"skn-error\">このパネルを編集し、HTML コンテンツを変更してください。</span></p><p>&nbsp;</p><p>&nbsp;</p>'),(1449,'pt','<p>&nbsp;</p><p><span class=\"skn-error\">Por favor, edite este painel e altere seu conteúdo HTML.</span></p><p>&nbsp;</p><p>&nbsp;</p>');
